var CoreMenu =
{
 //Top Menu
 init:function()
 {
  this.level0_init();
  this.lower_menu_init();
  this.user_dropdown_init();
 },
 top_overlay:false,
 level0_init:function()
 {
	$(".dropdown-menu").each(function()
		{
		 var $drop = $(this);
    	 var isOverflowing = ($(this).parent().offset().left+$drop.width() ) > 1024;
    	 if(isOverflowing){
    		$(this).addClass('right-dropdown');
    		$(this).css('margin-left',-$drop.width()/2+2)
    	 }
		 $(this).parent().hover(function(){ $('.dropdown-menu:eq(0)', this).show(); },
		                        function(){ $('.dropdown-menu:eq(0)', this).hide(); });
		})
 },

 
 //Lower Menu
 animating:false,
 lower_menu_init:function()
 {
  var $self = this;
  $(".lower-item").hover(function() 
  	  {if($self.animating==false){  $self.animating=true;
  	    $(this).parent().children(".hover-blob").fadeIn(100,
  	    	function(){ $(this).parent().children(".lower-item").css("margin-top","-5px"); setTimeout(function(){$self.animating=false;},30);}); 
  	    		}},
  	    function() { $(".lower-item").css("margin-top","0px"); $(".lower-item").parent().children(".hover-blob").fadeOut("fast")});
 },
 udropdown_opened:false,
 user_dropdown_init:function()
 {
  var $self = this;
  $("#user-button").live("click",function(){
  if($self.udropdown_opened==false){
    $("#user-button").css("background-position","0px 15px");
    $("#user-dropdown").fadeIn("fast");
    $self.udropdown_opened = true;
   }else {
    $("#user-button").css("background-position","0 0");
    $("#user-dropdown").fadeOut("fast");
    $self.udropdown_opened = false;
   }
  });
 }
/*End Of [Object]*/
};


var CoreTabs =
{
 prev_top:-1, //$(this)[0].prev_left
 prev_left:-1,//$(this)[0].prev_top
 init:function()
 {
  this.close_button_events();
  this.tab_open_event();
 },
 close_tabs:function() {
 var $self = this;
    $("#inner-tabs div.tab-text").each(function(a) {
        if ($(this).parent().attr("open") == "true") {
        $(".close").css("display", "none");
        $(this).parent().attr("open", "false");
        var $prev_top = $(this).parent().offset().top;
        var $prev_left = $(this).parent().offset().left;
        var l = ($prev_left + $self.prev_left).toString();
        $(this).parent().animate({right:'0'});
        $(this).parent().offset({
            top: $self.prev_top
        });
        $(this).parent().children(".tab-content").css("display", "none");
        
        }
        
    });
    $self.prev_top=-1;
    $self.prev_left=-1;
  },
 
 tab_open_event:function()
 {
  var self = this;
  $("#inner-tabs div.tab-text").live("click", function() {
    if ($(this).parent().attr("open") != "true") {
        self.close_tabs();
        $(this).parent().attr("open", "true");
        var $mod = 200;
        var $prev_left = $(this).parent().offset().left;
        var $prev_top = $(this).parent().offset().top;
        if (self.prev_top == -1) self.prev_top = $prev_top;
        var adj = $(this).parent().children(".tab-content").width();
        if (self.prev_left == -1) self.prev_left = adj + 50;
        if ($.browser.msie == true) $mod = 109;
        
        var l = (adj+50).toString();
        $(this).parent().animate({right:l});
        $(this).parent().offset({
            top: $mod
        });
        
        $(".close").css("display", "block");
        if ($.browser.msie != true)
         $(".close").css({top:($prev_top-95)});
        else
          $(".close").css({top:$prev_top});
        $(this).parent().children(".tab-content").css("display", "block");
    } else {
    	$(".close").css("display", "none");
        $(this).parent().attr("open", "false");
        var $prev_top = $(this).parent().offset().top;
        var $prev_left = $(this).parent().offset().left;

        $(this).parent().animate({right:'0'});
        $(this).parent().offset({
            top: self.prev_top
        });
        $(this).parent().children(".tab-content").css("display", "none");
       }
    });
 },
  close_button_events:function()
  {
  	var self = this;
    $(".circle-close").click(function(){ self.close_tabs();});
    $(".close").click(function(){ self.close_tabs();});
  }


 /*End Of [Object]*/
};


